// SPDX-License-Identifier: MIT
pragma solidity ^0.8.10;

import './interfaces/INullWallet.sol';

contract NullWallet is INullWallet {

    address Factory;
    address payable reciever;
    address owner;
    address NATIVE = 0x0000000000000000000000000000000000000000;
    

    constructor ()  {
            Factory = msg.sender;
    }

    function Initialize(address _reciever, address _owner) public {
        require(msg.sender == Factory,'Forbidden call');
        reciever = payable(_reciever);
        owner = _owner;
    }

    function Withdraw(address _token)  external {
        require(msg.sender == Factory,'Forbidden call');
        if (_token == NATIVE) {
            reciever.transfer(address(this).balance);
        }

    }

    



}
